window.bookSummaryJSON = "<p>Bezu is a beautiful Southern Belle with genteel manners. But her problems are anything but. Deep in debt, she's illegally taken in a few lodgers. A sweet stripper and her bodybuilder boyfriend, an Asian man loudly learning English through pop music, and a mysterious stranger with the most amazing blue green eyes - and a secret. When one of them mysteriously dies and it looks like her muffins were the murder weapon, Bezu and her fellow amateur sleuth, Cat, must discover who the killer is before she ends up in jail...or worse. Will they succeed?</p> <p>Find out in <i>Murderous Muffins</i>, book two in the Georgia Coast Cozy Mystery series.</p>"; 
